               \
               local self = aura_env.region\
               local privateAnchorArgs = {\
                   unitToken = aura_env.config.unit,\
                   auraIndex = aura_env.state.index,\
                   parent = self,\
                   showCountdownFrame = true,\
                   showCountdownNumbers = true,\
                   iconInfo = {\
