          ["custom"] = "function(s, e, ...)\
          if e == \"OPTIONS\" then\
              local state = {\
                  progressType = \"timed\",\
                  duration = aura_env.alert,\
                  expirationTime = aura_env.alert+GetTime(),\
                  autoHide = true,\
              }\
              s:Update(\"\", state)\
          elseif e == \"NS_MATRIX_ALERT\" then\
              local state = {\
                  progressType = \"timed\",\
                  duration = aura_env.alert,\
                  expirationTime = aura_env.alert+GetTime(),\
                  autoHide = true,\
              }\
              s:Update(\"\", state)\
          elseif e == \"NSAPI_ENCOUNTER_START\" then\
              aura_env.casts = 0\
          elseif e == \"ENCOUNTER_END\" then\
              if aura_env.next then aura_env.next:Cancel() end\
          else\
              local u, cast, spellID = ... -- Unit event\
              if spellID == aura_env.cast or spellID == aura_env.transition1 or spellID == aura_env.transition2 or spellID == aura_env.transition3 then\
                  aura_env.casts = aura_env.casts+1\
                  local duration = 0\
                  if aura_env.timer[aura_env.casts] then duration = aura_env.timer[aura_env.casts]-aura_env.alert end            \
                  local aura_env = aura_env\
                  aura_env.next = C_Timer.NewTimer(duration, function() WeakAuras.ScanEvents(\"NS_MATRIX_ALERT\", aura_env.id) end) \
              end\
          end\
      end\
      \
