                               local casttime = 2\
                               local timeaftercombo = 1.4\
                               local duration = (not stacks and casttime+(diff*2)) or (stacks == 2 and casttime) or (stacks == 1 and casttime+diff) or casttime\
                               duration = duration+timeaftercombo\
                               local state = {\
