                                   tick2 = duration == casttime+(diff*2)+timeaftercombo and true,\
                                   tick3 = duration == casttime+(diff*2)+timeaftercombo and true,\
                                   autoHide = true,\
                               }\
                               s:Update(\"\", state)\
                           end    \
                       end\
                   end\
